    protected void Page_Load(object sender, EventArgs e)
    {
        if (Session["session-id_admin"] == null)
        {
   
            Response.Redirect("Home.aspx");
        }
      
        Label10.Text = datepickerr.Text;
        if (!Page.IsPostBack)
        {
            con.Open();
            BindData();
        }
        if(Page.IsPostBack)
        {
            con.Open();
            BindData();
        }
        else
        {
            Label2.Text = Session["session-id_admin"].ToString();

        }
    }
    void BindData()
    {
     |
        String strSQL;
        if (datepickerr.Text != "")
        {
            var s = datepickerr.Text;
            DateTime q = Convert.ToDateTime(s);
            strSQL = "SELECT * FROM booking_labs where date_loan = '" + q.ToString("yyyy-MM-dd", new System.Globalization.CultureInfo("en-US")) + "'";

            SqlDataReader dtReader;
            SqlCommand objCmd = new SqlCommand(strSQL, con);
            dtReader = objCmd.ExecuteReader();

            //*** BindData to Repeater ***//
            myRepeater.DataSource = dtReader;
            myRepeater.DataBind();

            dtReader.Close();
            dtReader = null;
        }
        con.Close();

    }
